import  message  from "./config/message.js";
import enviroment from "./config/enviroment"

const app = Express();


app.set("PORT",process.env.PORT || 3001);

app.listen(app.get("PORT"),()=>{

    message(`Esta conectado al Puerto:${app.get("PORT")}`, "success");


});

